long.am,ar,bn,ca,cs,da,el,en,en_AU,en_GB,en_U:
Screenshot YouTube Video is a compact and user-friendly extension that allows you to take a screenshot of YouTube and OK.ru videos and save the frame to your PC without using third-party programs and without cropping the video player frames. Ready-to-use frame from a movie or clip in maximum quality with just one click of the cursor.

It is easy to find the Video Screenshot Button — that's the camera image in the lower part of the player.

Features of the browser extension:
— The button is well-integrated into the design of the YouTube and OK.ru video players; 
— Screen capture in JPEG format and without the frames of the video player;
— Downloaded frames have readable (human-friendly) names;
— "Embedded" video frame loading support, i.e. YouTube and OK.ru videos hosted on third-party sites;

long.bg:
Screenshot YouTube Video е компактно и удобно за потребителя разширение, което ви позволява да направите екранна снимка на видеоклипове в YouTube и OK.ru и да запазите рамката на вашия компютър, без да използвате програми на трети страни и без да изрязвате кадрите на видеоплейъра. Готов за използване кадър от филм или клип с максимално качество само с едно щракване на курсора.

Лесно е да намерите бутона Video Screenshot — това е изображението на камерата в долната част на плейъра.

Характеристики на разширението на браузъра:
— Бутонът е добре интегриран в дизайна на видеоплейърите YouTube и OK.ru;
— Заснемане на екрана във формат JPEG и без кадрите на видеоплейъра;
— Изтеглените рамки имат четливи (удобни за човека) имена;
— Поддръжка за зареждане на "вградени" видео кадри, т.е. видеоклипове в YouTube и OK.ru, хоствани на сайтове на трети страни.


Важно: разширението не поддържа екранни снимки от YouTube Shorts.

long.de:
Screenshot YouTube Video ist eine praktische und kompakte Erweiterung, mit der Sie einen Screenshot von YouTube und OK.ru Videos machen und den Frame auf Ihrem PC speichern können, ohne Programme von Drittanbietern zu verwenden und ohne die Frames des Videoplayers zuzuschneiden. Einfach und sicher, keine Viren oder Werbung. Ein fertiges Bild aus einem Film oder Video in maximaler Qualität mit nur einem Mausklick.

Es ist einfach, den Screenshot-Button zu finden – es ist das Bild der Kamera am unteren Rand des Players.

Eigenschaften der Erweiterung:
— Der Button ist harmonisch ins Design des Videoplayers auf YouTube und OK.ru integriert;
— Einzelbildaufnahme im üblichen JPEG-Format und ohne die Einzelbilder des Videoplayers;
— Der Frame wird wie auf der Service-Website mit dem ursprünglichen Videonamen gespeichert;
— Herunterladen von Screenshots aus eingebetteten Videos, d.h. Videos von YouTube und Odnoklassniki, die auf Websites Dritter gehostet werden.

long.es:
Screenshot YouTube Video es una extensión práctica y compacta que te permite hacer una captura de pantalla de los vídeos de YouTube y OK.ru y guardar el fotograma en el PC sin utilizar el software de terceros ni recortar los fotogramas del reproductor de vídeo. Fácil y seguro, sin virus ni anuncios. Tendrá el fotograma final de la película o el vídeo en la máxima calidad con sólo hacer clic con el cursor.

Encontrar el botón de captura de pantalla es sencillo: es la imagen de la cámara situada en la parte inferior del reproductor.

Características de la extensión:
— El botón se integra perfectamente en el diseño del reproductor de vídeo de YouTube y OK.ru;
— Captura un fotograma en el conocido formato JPEG y sin el marco de un reproductor de vídeo;
— El fotograma se guarda con el título original del vídeo, como en el sitio web del servicio;
— Soporte para subir las capturas de pantalla de vídeos “insertados” (embedded), es decir, los vídeos de YouTube y Odnoklassniki alojados en los sitios de terceros.

long.fr:
Screenshot YouTube Video est une extension pratique et compacte qui vous permet de prendre une capture d’écran des vidéos YouTube et OK.ru et d’enregistrer une image dans PC sans utiliser de programmes tiers et sans recadrer les images du lecteur vidéo. Une image finie d'un film ou d'un clip en qualité maximale en un seul clic du curseur.

Il est facile de trouver le bouton de capture d’écran - c’est une image de la caméra en bas du lecteur.

Fonctionnalités d’extension :
— Le bouton est harmonieusement intégré dans la conception du lecteur vidéo YouTube et OK.ru;
— Capturez une image en habituel format de JPEG et sans boîte du lecteur vidéo ;
