long.id:
Screenshot YouTube Video adalah ekstensi yang ringkas dan ramah pengguna yang memungkinkan Anda mengambil tangkapan layar video YouTube dan OK.ru dan menyimpan bingkai ke PC Anda tanpa menggunakan program pihak ketiga dan tanpa memotong bingkai pemutar video. Bingkai yang siap digunakan dari film atau klip dalam kualitas maksimum hanya dengan satu klik kursor.


Sangat mudah untuk menemukan Tombol Tangkapan Layar Video — yaitu gambar kamera di bagian bawah pemutar.


Fitur ekstensi browser:
— Tombol ini terintegrasi dengan baik ke dalam desain pemutar video YouTube dan OK.ru;
— Cuplikan Layar dalam format JPEG dan tanpa bingkai pemutar video;
— Bingkai yang diunduh memiliki nama yang mudah dibaca (ramah manusia);
— Dukungan pemuatan tangkapan layar video "tertanam", yaitu video YouTube dan OK.ru yang dihosting di situs pihak ketiga.


Penting: ekstensi tidak mendukung tangkapan layar dari YouTube Shorts.

long.it:
Screenshot YouTube Video è un'estensione pratica e compatta che permette di fare uno screenshot dei video di YouTube e OK.ru e di salvare la immagine sul PC senza utilizzare programmi di terze parti o ritagliare le immagine del lettore video.  Semplice e sicuro, senza virus e pubblicità. Una immagine pronta di un filmato o di una clip con la massima qualità in un solo clic del cursore.

Trovare il tasto screenshot è facile: è l'immagine della fotocamera nella parte inferiore del lettore.

Caratteristiche dell'estensione:
— Il tasto è integrato nel design del lettore video di YouTube e OK.ru in modo armonioso;
— Acquisizione di un'immagine nel conosciuto formato JPEG e senza immagini del lettore video;
— L'immagine viene salvata con il titolo originale del video, come sul sito;
— Supporto per il download di screenshot da video "incorporati" (embedded), cioè video di YouTube e Odnoklassniki ospitati su siti di terze parti.


Importante: l'estensione non supporta il salvataggio di schermate dai Shorts di YouTube.

long.nl:
Screenshot YouTube Video is een handige en compacte extensie waarmee je een screenshot kunt maken van YouTube- en OK.ru-video's en het frame op je pc kunt opslaan zonder programma's van derden te gebruiken en zonder de frames van de videospeler bij te snijden.  Eenvoudig en veilig, zonder virussen en advertenties. Klaar frame van een film of clip in maximale kwaliteit in slechts één klik van de cursor.

De schermopnameknop is gemakkelijk te vinden - het is het camerabeeld aan de onderkant van de speler.

Extensie-eigenschappen:
— De knop is harmonieus geïntegreerd in het design van de videospeler van YouTube en OK.ru;
— Frames vastleggen in het gebruikelijke JPEG-formaat en zonder frames van de videospeler;
— Het frame wordt opgeslagen met de originele videonaam, zoals op de website van de service;
— Ondersteuning voor het downloaden van schermopnamen van "ingesloten" (embedded) video's, d.w.z. video's van YouTube en Odnoklassniki die worden gehost op sites van derden.


Belangrijk: de extensie biedt geen ondersteuning voor het opslaan van screenshots van YouTube Shorts.

long.pl:
Screenshot YouTube Video — jest to poręczne i kompaktowe rozszerzenie, które pozwala zrobić zrzut ekranu wideo z YouTube i OK.ru i zapisać obraz na komputerze bez korzystania z programów innych firm lub przycinania ramek odtwarzacza wideo.. Proste i bezpieczne, wolne od wirusów i reklam. Gotowy obraz z filmu lub pliku filmowego w maksymalnej jakości za pomocą jednego naciśnięcia kursora.

Znalezienie przycisku robienia zrzutu ekranu jest proste — jest to obraz aparatu na dole odtwarzacza.

Cechy rozszerzenia:
— Przycisk harmonijnie osadza się z projektem odtwarzacza wideo YouTube i OK.ru;
— Zrzut ekranu w znanym formacie JPEG i bez ramek odtwarzacza wideo;
— Zrzut jest zapisywany z oryginalnym tytułem filmu, Jak na stronie internetowej serwisu;
— Wsparcie dla pobierania zrzutów ekranu z "osadzonych" (embedded) filmów, czyli filmów z YouTube i Odnoklassniki hostowanych w witrynach stron trzecich.

long.pt_BR:
Screenshot YouTube Video é uma extensão prática e compacta que permite tirar uma foto do YouTube e vídeos OK.ru e salvar o frame em seu PC sem usar software de terceiros ou cortar o frame do reprodutor de vídeo.  Fácil e seguro, sem vírus ou anúncios. Filmagens acabadas de um filme ou vídeo em qualidade máxima com apenas um clique do rato.

Encontrar o botão de captura de tela é fácil - é a imagem da câmera na parte inferior do reprodutor.

Características da extensão:
— O botão se funde perfeitamente no projeto do reprodutor de vídeo YouTube e OK.ru;
— Captura do quadro no formato JPEG familiar e sem o quadro do reprodutor de vídeo;
— O quadro é salvo com o nome original do vídeo, como no site de serviço;
— Suporte a download dos vídeos “embedded”, ou seja vídeo do YouTube e Odnoklassniki hospedados em sites de terceiros.

long.ro:
Screenshot YouTube Video — aceasta este o extensie convenabilă și compactă care vă permite să faceți o captură de ecran a unui video YouTube și OK.ru și salvați cadrul pe un computer fără a utiliza programe terțe și fără a decupa cadrul playerului video.  Simplu și sigur, fără viruși și reclame. Un cadru terminat dintr-un film sau video în calitate maximă într-un singur clic al cursorului.

Este ușor să găsiți butonul de captură de ecran — aceasta este imaginea camerei din partea de jos a playerului.

Caracteristicile extensiei:
– Butonul este integrat armonios în designul playerului video YouTube și OK.ru;
– Capturați un cadru în cunoscutul format JPEG și fără cadrele playerului video;
– Cadrul este salvat cu titlul original al video, ca pe site-ul serviciului;
– Suport pentru descărcarea capturilor de ecran din video „încorporate”, adică videoc de la YouTube și Odnoklassniki găzduite pe site-uri terțe.


Important: extensia nu acceptă salvarea capturilor de ecran din YouTube Shorts.

long.ru:
Screenshot YouTube Video — это удобное и компактное расширение, которое позволяет сделать скриншот видео YouTube и OK.ru и сохранить кадр на ПК, не используя сторонние программы и не обрезая рамки видеоплеера.  Просто и безопасно, без вирусов и рекламы. Готовый кадр из фильма или ролика в максимальном качестве всего за одно нажатие курсора.

Найти кнопку съёмки скриншота просто — это изображение фотоаппарата в нижней части проигрывателя.

Особенности расширения:
— Кнопка гармонично встраивается в дизайн видеоплеера YouTube и OK.ru;
— Захват кадра в привычном формате JPEG и без рамок видеоплеера;
— Кадр сохраняется с оригинальным названием видео, как на сайте сервиса;
— Поддержка загрузки скриншотов из «встроенных» (embedded) видео,

long.sv:
Screenshot YouTube Video är ett kompakt och användarvänligt tillägg som låter dig ta en skärmdump av YouTube- och OK.ru-videor och spara ramen på din PC utan att använda tredjepartsprogram och utan att beskära videospelarens ramar. Färdig att använda ram från en film eller ett klipp i högsta kvalitet med bara ett klick med markören.

Det är lätt att hitta knappen Video Screenshot — det är kamerabilden i spelarens nedre del.

Funktioner i webbläsartillägget:
— Knappen är väl integrerad i designen av YouTube och OK.ru videospelare;
— Skärmdump i JPEG-format och utan ramar från videospelaren;
— Nedladdade ramar har läsbara (människovänliga) namn;
— Stöd för laddning av "inbäddad" videoram, dvs YouTube- och OK.ru-videor som finns på tredjepartswebbplatser.


Viktigt: tillägget stöder inte skärmdumpar från YouTube Shorts.

long.tr:
Screenshot YouTube Video, YouTube ve OK.ru videolarının ekran görüntüsünü almanızı ve üçüncü taraf programları kullanmadan veya video oynatıcı çerçevelerini kırpmadan çerçeveyi bilgisayarınıza kaydetmenizi sağlayan kullanışlı ve kompakt bir uzantıdır.  Virüs ve reklam içermeyen basit ve güvenli. İmlece tek bir tıklamayla bir filmden veya klipten maksimum kalitede hazır kare.

Ekran görüntüsü düğmesini bulmak kolaydır - oynatıcının altındaki kamera görüntüsüdür.

Uzantının özellikleri:
— Düğme, YouTube ve OK.ru video oynatıcısının tasarımına uyumlu bir şekilde entegre edilmiştir;
— Bilinen JPEG formatında ve video oynatıcı kareleri olmadan kare yakalama;
— Çerçeve, hizmetin web sitesinde olduğu gibi videonun orijinal başlığıyla birlikte kaydedilir;
— Gömülü (embedded) videolardan, yani üçüncü taraf sitelerde barındırılan YouTube ve Odnoklassniki videolarından ekran görüntüleri yükleme desteği.


Önemli: Uzantı, YouTube Shorts'tan ekran görüntülerinin kaydedilmesini desteklemez.

long.uk:
Screenshot YouTube Video – це зручне та компактне розширення, яке дозволяє зробити скріншоти відео YouTube та OK.ru та зберегти кадр на комп’ютер без використання сторонніх програм та не обрізаючи рамки відеоплеєру. Просто та безпечно, жодних вірусів і без реклами. Готовий кадр із фільму або ролика всього за один клік.

Знайти кнопку зйомки скріншоту доволі просто – це зображення фотоапарату в нижній частині програвача.

Особливості розширення

— Кнопка гармонійно вбудовується у дизайн відеоплеєру <b>YouTube та OK.ru;
— Захоплення кадру у звичному форматі JPEG та без рамок відеоплеєра;
— Кадр зберігається з оригінальною назвою відео, як на сайті сервісу;
— Підтримка збереження скріншотів із “вбудованих” (embedded) відео, тобто відео з YouTube та Однокласників, які розміщено на сторонніх сайтах.

long.vi:
Screenshot YouTube Video - là một tiện ích tiện lợi và nhỏ gọn, cho phép bạn chụp ảnh màn hình video từ YouTube và OK.ru, đồng thời lưu khung hình trên máy tính riêng mà không cần sử dụng chương trình của bên thứ ba, và cũng như không cắt xén khung hình của trình phát video. Đơn giản và an toàn, không có virus và quảng cáo. Một khung hình hoàn chỉnh từ phim hoặc video với chất lượng tối đa chỉ bằng một cú nhấp chuột.

Việc tìm nút chụp màn hình rất dễ dàng - đó là hình ảnh một chiếc camera ở phần dưới nút phát nhạc.

Tính năng mở rộng:
— Nút ấn được tích hợp hài hòa vào thiết kế của trình phát video YouTube và OK.ru;
— Chụp khung ảnh ở định dạng JPEG thông thường và không có khung trình phát video;
— Hình ảnh được lưu cùng với tiêu đề video gốc như trên trang web dịch vụ;
— Hỗ trợ tải video “được nhúng” (embedded), tức là video từ YouTube và Odnoklassniki, được lưu trữ trên trang web của bên thứ ba;

Chú ý: tiện ích này không hỗ trợ lưu ảnh chụp màn hình từ YouTube Shorts.
